        DampedRational[1,{},1/E,x],{{Flatten[{Table[mu1^((i+1)/2)(G[i, 10, Sqrt[mu1]*b, mu1] + B[i, 10, Sqrt[mu1]*b, mu1]),{i,3/2,num1}], list0}],Flatten[{Table[mu1^((i+1)/2)(F[i, 10,Sqrt[mu1]*b, mu1]),{i,3/2,num1}], list0}]},
        {Flatten[{Table[mu1^((i+1)/2)(F[i, 10, Sqrt[mu1]*b, mu1]),{i,3/2,num1}], list0}],Flatten[{Table[mu1^((i+1)/2)(G[i, 10, Sqrt[mu1]*b, mu1] - B[i, 10, Sqrt[mu1]*b, mu1]),{i,3/2,num1}], list0}]}}];

Polydis[b_, x_]:=PositiveMatrixWithPrefactor[
        DampedRational[1,{},1/E,x],{{Flatten[{Table[H[n,10,b, mu1],{n,3/2,num1}], list0}]}}]        
